import React, {Component} from "react";

export class Searchbar extends Component {
  render() {
    return (
      <div>
        <>
          <input
            type='text'
            placeholder='Search something'
            className='fa-sharp fa-solid fa-magnifying-glass'
          />
        </>
      </div>
    );
  }
}

export default Searchbar;
